import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './App.css';
import SecuredPage from './SecuredPage';


export default function App() {
  return (
    <BrowserRouter>
    <h1>Keycloack Auth</h1>
    <Routes>
    <Route path="/secured" element={<SecuredPage />} />
    </Routes>
    </BrowserRouter>
  )
};
